import React from 'react'
import {Link} from "react-router-dom";

export default function RegisterPage() {
    function validateFunction(email, user, pass){
        const registerError = document.getElementById("registerError");
        if (email === "" || user === "" || pass === "")
        {
            if (email === "")
            {
                registerError.innerText = "please enter an email"
            }
            else if(user === "")
            {
                registerError.innerText = "please enter a user name"
            }
        }
    }

    return (
        <div>
            <form id="registerpanel">
                <h1 id="litheader">Register</h1>
                <div className="inset">
                    <p>
                        <input type="text" name="email" id="email" placeholder="Email"/>
                    </p>
                    <p>
                        <input type="text" name="username" id="username" placeholder="User Name"/>
                    </p>
                    <p>
                        <input type="password" name="password" id="password" placeholder="Password"/>
                    </p>
                </div>
                <div className="p-container" id="registerError"></div>
                <p className="p-container">
                    <Link to='/login'><button onClick={validateFunction(document.getElementById("email").innerText, document.getElementById("username").innerText, document.getElementById("password").innerText)}>Register</button></Link>
                </p>
            </form>
            <script>
                console.log("hello");
            </script>
        </div>
    )
}
